import "./About.css";
import SkillComponent from "./SkillComponent";
const skills = [
  "JavaScript", "Java", "C#","C", "Python", "React", "Blazor", "React Native", "AWS Cloud", "SQL", "PostgreSQL", "Ruby", "Rust", "OCaml", "Swift"
]

function About() {
  return (
    <div className="containerA">
      <div id="left">
        <h2 className="about_sub">Who am I?</h2>
        <p>&emsp; Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum varius
          neque sit amet faucibus sollicitudin. Nulla lacinia venenatis felis sit amet
            lobortis. Ut cursus fringilla iaculis. Ut egestas gravida tellus, in rhoncus
            leo feugiat eu. Mauris hendrerit dapibus libero nec accumsan. Proin volutpat
              eget enim id commodo. Nunc dictum felis sit amet lorem lobortis, in suscipit
              enim vulputate.
        </p>
      </div>
      <div id="right">
        <h2 className="about_sub">My Skills</h2>
        <div id="wrapper">
          <div id="skills-container">
            {skills.map(skill => (
              <SkillComponent name={skill}/>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
